import SweetAlert from "react-bootstrap-sweetalert";

function Modal() {
  return (
    <div>
      <SweetAlert show={true} success title="Woot!" onConfirm={console.log("A")}>
        I did it!
      </SweetAlert>
    </div>
  );
}

export default Modal;
